                        Reviewed in the United States on February 6, 2015






            Great mic to step up in quality from a cheapo headset mic. Even though this is an entry level mic, it is a great value for the price. If you are looking to start a podcast this is the perfect mic without breaking the bank.Unfortunately there is a big time delay when wanting to monitor the mic with headphones. If you need to monitor yourself, buy a mic that plugs straight into the mic jack and not the USB port. I took off one star for this.Personally I don't need a monitor myself when recording so this mic fits my needs well. I thought I'd mention it though.UPDATE: I built out a little nook in my closet with some acoustic foam. This mic records even more great now!!! This is a fantastic mic to get in to recording voice or youtube videos.



